def sdi(data):
    def p(n, N):
        """ Relative abundance """
        if n is  0:
            return 0
        else:
            return (float(n)/N) * ln(float(n)/N)
            
    N = sum(data)
    
    return -sum(p(n, N) for n in data if n is not 0)



